const canvas = document.getElementById("canvas1");
const ctx = canvas.getContext("2d");
canvas.width = 800;
canvas.height = 450;

const image1 = new Image();
// image1.src = './src/pixel-manipulation/image1.png';
image1.src =
  "data:image/png;base64,";

let effectStep = 0;
let effectProgress = 0;
const effectSpeed = 0.01; // Controls smoothness of transitions
let isFirstGrayscaleApplied = false;

image1.onload = function () {
  ctx.drawImage(image1, 0, 0, canvas.width, canvas.height);

  setTimeout(() => {
    applyGrayscale();
    isFirstGrayscaleApplied = true;
    setTimeout(() => {
      requestAnimationFrame(animateEffects);
    }, 500);
  }, 1000);
};

function applyGrayscale() {
  const scannedImage = ctx.getImageData(0, 0, canvas.width, canvas.height);
  const scannedData = scannedImage.data;

  for (let i = 0; i < scannedData.length; i += 4) {
    const avg = (scannedData[i] + scannedData[i + 1] + scannedData[i + 2]) / 3;
    scannedData[i] = avg;
    scannedData[i + 1] = avg;
    scannedData[i + 2] = avg;
  }

  ctx.putImageData(scannedImage, 0, 0);
}

function animateEffects() {
  if (!isFirstGrayscaleApplied) return;

  ctx.drawImage(image1, 0, 0, canvas.width, canvas.height);
  const scannedImage = ctx.getImageData(0, 0, canvas.width, canvas.height);
  const scannedData = scannedImage.data;

  for (let i = 0; i < scannedData.length; i += 4) {
    let blendFactor = Math.min(effectProgress, 1);

    if (effectStep >= 1) {
      scannedData[i] =
        scannedData[i] * (1 - blendFactor) +
        (255 - scannedData[i]) * blendFactor;
      scannedData[i + 1] =
        scannedData[i + 1] * (1 - blendFactor) +
        (255 - scannedData[i + 1]) * blendFactor;
      scannedData[i + 2] =
        scannedData[i + 2] * (1 - blendFactor) +
        (255 - scannedData[i + 2]) * blendFactor;
    }

    if (effectStep >= 2) {
      scannedData[i] = Math.min(255, scannedData[i] + 30 * blendFactor);
      scannedData[i + 1] = Math.min(255, scannedData[i + 1] + 30 * blendFactor);
      scannedData[i + 2] = Math.min(255, scannedData[i + 2] + 30 * blendFactor);
    }

    if (effectStep >= 3 && i % 500 === 0) {
      scannedData[i] = scannedData[i + 4] || scannedData[i];
      scannedData[i + 1] = scannedData[i + 5] || scannedData[i + 1];
      scannedData[i + 2] = scannedData[i + 6] || scannedData[i + 2];
    }

    if (effectStep >= 4) {
      let r = scannedData[i];
      let g = scannedData[i + 1];
      let b = scannedData[i + 2];

      scannedData[i] = Math.min(255, r * 0.393 + g * 0.769 + b * 0.189);
      scannedData[i + 1] = Math.min(255, r * 0.349 + g * 0.686 + b * 0.168);
      scannedData[i + 2] = Math.min(255, r * 0.272 + g * 0.534 + b * 0.131);
    }

    if (effectStep >= 5) {
      let r = scannedData[i];
      let g = scannedData[i + 1];
      let b = scannedData[i + 2];

      scannedData[i] = g;
      scannedData[i + 1] = b;
      scannedData[i + 2] = r;
    }

    if (effectStep >= 6 && i % 10 === 0) {
      scannedData[i] = scannedData[i + 4] || scannedData[i];
      scannedData[i + 1] = scannedData[i + 5] || scannedData[i + 1];
      scannedData[i + 2] = scannedData[i + 6] || scannedData[i + 2];
    }

    if (effectStep >= 7) {
      let factor = (i % 100) / 100;
      scannedData[i] *= factor;
      scannedData[i + 1] *= factor;
      scannedData[i + 2] *= factor;
    }

    if (effectStep >= 8) {
      scannedData[i] = Math.abs(255 - scannedData[i]) * blendFactor;
      scannedData[i + 1] = Math.abs(255 - scannedData[i + 1]) * blendFactor;
      scannedData[i + 2] = Math.abs(255 - scannedData[i + 2]) * blendFactor;
    }

    if (effectStep >= 9) {
      scannedData[i] = scannedData[i] > 128 ? 255 : 0;
      scannedData[i + 1] = scannedData[i + 1] > 128 ? 255 : 0;
      scannedData[i + 2] = scannedData[i + 2] > 128 ? 255 : 0;
    }
  }

  ctx.putImageData(scannedImage, 0, 0);

  effectProgress += effectSpeed;

  if (effectProgress >= 1) {
    effectStep = (effectStep + 1) % 10;
    effectProgress = 0;
  }

  requestAnimationFrame(animateEffects);
}
